package w3resource;

public class IfElseIfCheck {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 6;
		
		if(i > 2) {
			System.out.println("I'm from i > 2");
		} else if (i > 4) {
			System.out.println("I'm from i > 4");
		} else {
			System.out.println("I'm from else");
		}
		
	}

}
